export const actionTypes = Object.freeze({

  LOGIN_STOP_FETCHING: 'login/stopFetching',
  LOGIN_SET_FETCHING_ERROR: 'login/setFetchingError',

  LOGIN_FILL: 'login/fill',
  LOGIN_SET_STATUS: 'login/setStatus',

  LOGIN_FETCH_ASYNC: 'login/fetchAsync',
});
